sys_variable_value.value:
(function execute(inputs, outputs) {
  let packagesUpdated = 0;
  let errorCount = 0;
  let errors = [];
  if (0 == inputs.packages_found) {
    outputs.packages_updated = packagesUpdated;
    outputs.error_count = errorCount;
    let msg = "No acquisition packages found for contract history migration. Stopping.";
    outputs.message = msg;
    gs.info(msg);
    return;
  } else {
    let msg = "Found " + inputs.packages_found + " acquisition packages for contract history migration.";
    outputs.message = msg;
    gs.info(msg);
  }

  let grContract = new GlideRecord('x_g_dis_atat_current_contract_and_recurring_information');
  while (inputs.packages.next()) {
    grContract.get(inputs.packages.current_contract_and_recurring_information.sys_id);
    //identify the parent in the child record
    grContract.acquisition_package = inputs.packages.sys_id;
    try {
      grContract.update();
      packagesUpdated++;
      gs.info("Processing parent acquisition package: " + inputs.packages.number + " (" + inputs.packages.sys_id + "); updated child record ("+ inputs.packages.current_contract_and_recurring_information.sys_id + ")");
    } catch (err) {
      errors.push({number:inputs.packages.number.toString(),sys_id:inputs.packages.sys_id.toString(),error:err.toString()});
      gs.error(err);
      errorCount++;
    }
  }

  //set outputs
  outputs.error_message = JSON.stringify(errors);
  outputs.error_count = errorCount;
  outputs.packages_updated = packagesUpdated;
  let msg = "Updated " + packagesUpdated + " child records of acquistion packages. Finished contract history migration. See Application Log for details.";
  outputs.message = msg;
  gs.info(msg);
})(inputs, outputs);

